# To find the number of enclaves
import sys
sys.setrecursionlimit(100000)
def findNumberOfEnclavesBFS(matrix):
    m = len(matrix); n = len(matrix[0])
    print(m, n)
    not_visited = []
    for i in range(m):
        if matrix[i][0] == 1:
            not_visited.append((i, 0))
        if matrix[i][n-1] == 1:
            not_visited.append((i, n-1))
    
    for i in range(1, n-1):
        if matrix[0][i] == 1:
            not_visited.append((0, i))
        if matrix[m-1][i] == 1:
            not_visited.append((m-1, i))
    
    group = []; cnt = 0
    while not_visited != [] or cnt != len(group):
        if cnt == len(group):
            group = [not_visited[0]]; cnt = 0
        
        node = group[cnt]; cnt += 1
        if node in not_visited:
            not_visited.remove(node)
        i, j = node; matrix[i][j] = 0

        if i-1 >= 0 and (i-1, j) not in group and matrix[i-1][j] == 1:
            #print('U')
            group.append((i-1, j))
        if i+1 < m and (i+1, j) not in group and matrix[i+1][j] == 1:
            group.append((i+1, j))
            #print('D')
        if j-1 >= 0 and (i, j-1) not in group and matrix[i][j-1] == 1:
            group.append((i, j-1))
            #print('L')
        if j+1 < n and (i, j+1) not in group and matrix[i][j+1] == 1:
            group.append((i, j+1))
            #print('R')
    
    cnt = 0
    for i in range(m):
        for j in range(n):
            if matrix[i][j] == 1:
                cnt += 1
    
    return cnt

def getNumberOfEnclavesDFS(grid):
    directions = [[1,0],[0,1],[-1,0],[0,-1]]
    def dfs(row,col):
        grid[row][col]=0
        for d in directions:
            r = row+d[0]
            c = col+d[1]
            if 0<=r<len(grid) and 0<=c<len(grid[0]) and grid[r][c]==1:
                dfs(r,c)
    for i in range(len(grid)):
        if grid[i][0]==1:
            dfs(i,0)
        if grid[i][len(grid[0])-1]==1:
            dfs(i,len(grid[0])-1)
    for i in range(len(grid[0])):
        if grid[0][i]==1:
            dfs(0,i)
        if grid[len(grid)-1][i]==1:
            dfs(len(grid)-1,i)
    count=0
        # print(visited)
    #print(grid)
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            if grid[i][j]==1:
                count+=1
    return count

